import React from "react";
import { Link } from "react-router-dom";

function Header() {
  return (
    <header className="header">
      <h1>My React App</h1>
      <nav>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/custom">Custom Page</Link></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
